import React from 'react';
import { Menu } from 'antd';


function SearchUser(props) {
    return (
        <Menu mode={props.mode}>
        <Menu.Item key="subscription" style={{width:'75px'}}>
        <p>user찾기</p>
        </Menu.Item>
      </Menu>
      )
}

export default SearchUser;
